import Link from "next/link";
import NProgress from "nprogress";
import { useEffect } from "react";

export default function Home() {
  useEffect(() => {
    NProgress.start();
    setTimeout(NProgress.done(), 3000);
  }, []);

  return (
    <>
      {process.env.customKey} Hello Word
      <ul>
        <li>
          <Link href="/detalhes">
            <a>About Us</a>
          </Link>
        </li>
      </ul>
    </>
  );
}
